class Solution {
    fun numberOfPowerfulInt(start: Long, finish: Long, limit: Int, s: String): Long {
        if (s.any { it > '0' + limit }) return 0 // Early return if any digit in s exceeds limit

        var count = 0L
        val startSuffix = s.toLong()
        var prefix = 0L

        while (true) {
            val currentValue = "$prefix$s".toLong()
            if (currentValue > finish) break
            if (currentValue >= start) count++

            if (prefix == 0L && startSuffix >= start && startSuffix <= finish) { // Handle no prefix case separately
                prefix = 1
            } else {
                var increment = 1L
                while (prefix / increment > 0) {
                    if ((prefix / increment) % 10 < limit) {
                        prefix += increment
                        break
                    } else {
                        prefix = (prefix / (increment * 10) + 1) * (increment * 10)
                    }
                    increment *= 10
                }
                if (increment > prefix) break // Overflow beyond limit handling
            }
        }

        return count
    }
}
